    false,nt"url": null,nt"notes": "BPI Structures are derived from two scales
    of a focal mean analysis on bathymetry and slope. The grid is based on gridded (10
    m cell size) multibeam bathymetry, collected aboard NOAA Ship Hi'ialakai and R/V
    AHI, and it was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
    Cell values represent one of 14 classes in an index of seafloor terrains. This data
    set is for the shelf and slope environments of Agrihan Island. As part of the northern
    islands of the Mariana Islands archipelago, Agrihan's offshore shelf, a small area
    on the south side, is above -60m. A deep shelf (below -60m) is northwest of the
    island and forms a small plateau. Conversely, the southern islands each have a shelf
    (above -100m) with escarpments that lead to broad flat areas without forming a deeper
    shelf.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
